import React from 'react';
import styled from 'styled-components';

const NameAndAttendanceStyled = styled.div`
  width: auto;
  display: flex;
  justify-content: center;
  align-items: center;
  height: 34px;
  margin: 30px 12px 30px 24px;
  flex-direction: column;
  h1 {
    font-size: ${theme.fontSize.l};
    margin: 0;
    color: #737c8e;
  }
  p {
    margin: 0;
    font-size: ${theme.fontSize.m};
    color: #737c8e;
  }
`;

const NameAndAttendance = () => <NameAndAttendanceStyled></NameAndAttendanceStyled>;

export default NameAndAttendance;
